    false,nt"url": null,nt"notes": "Summer surveys (Julyb??August) of juvenile
    salmon ecology along the continental shelf of the Gulf of Alaska are conducted annually
    by scientists from the Ocean Carrying Capacity program of the National Marine Fisheries
    Serviceb??s Auke Bay Laboratory. These surveys are an effort to link changes in
    salmon production to biological and physical factors in the ocean environment. An
    improved understanding of salmon distribution is one objective of this research.
    We identified the origin of juvenile chum salmon collected in transects from around
    the Gulf of Alaska in 2000 and 2001, using the presence of thermal marks in hatchery
    fish and the divergence of genetic characteristics among regional groups of populations.",nt"owner_org":
